import { createRef, useDebugValue, useState } from "react";
import React from "react";
import {
  View,
  Image,
  TouchableOpacity,
  GestureResponderEvent,
  Animated,
  Dimensions,
  ScrollView,
  Easing,
} from "react-native";
import {
  useAnimatedRef,
  useDerivedValue,
  useSharedValue,
  scrollTo,
} from "react-native-reanimated";
import { headerstyles } from "../Styles/HeaderStyle";
import MagnifyingGlass from "./Headers containers/MagnifyingGlass";
import ModeOfEmployment from "./Headers containers/ModeOfEmployment";
import Line from "./Headers containers/Line";
import MySelfUser from "../1HelpFullFolder/MySelfUser";
const { width: screenWidth, height: screenHeight } = Dimensions.get("window");
export default function Header({ mySelfUser }: { mySelfUser: MySelfUser }) {
  const timeForLineAnimation: number = 150;
  const rotateGradusOfLines: number = 45;
  const kefOfTransform: number = 0.75;
  const scrollViewRef = useAnimatedRef<ScrollView>();
  const topLineValue = useState(new Animated.Value(0))[0];
  const middleLineValue = useState(new Animated.Value(1))[0];
  const bottomLineValue = useState(new Animated.Value(0))[0];
  const scrollX = useState(new Animated.Value(0))[0];
  const [state, setState] = useState(1);
  const topLineRotation = topLineValue.interpolate({
    inputRange: [0, 1,2],
    outputRange: ["0deg", `-${rotateGradusOfLines}deg`,`-${rotateGradusOfLines}deg`],
  });
  const bottomLineRotation = bottomLineValue.interpolate({
    inputRange: [0, 1,2],
    outputRange: ["0deg", `${rotateGradusOfLines}deg`,`${rotateGradusOfLines}deg`],
  });
  const positionXOfTopLine = topLineValue.interpolate({
    inputRange: [0, 1,2],
    outputRange: [0, screenHeight * 0.01,screenHeight*0.01],
  });
  const scrollXPosition = scrollX.interpolate({
    inputRange: [0, 1],
    outputRange: [0, -screenWidth*0.8]
  });
  const hamburgerAnimation = (e: GestureResponderEvent) => {
    setState(state == 0 ? 1 :0);
    console.log(state)
    lineTransformation(e);
  };
  const lineTransformation = (e: GestureResponderEvent) => {
    const firstAnimatedTopLine=Animated.timing(topLineValue, {
      toValue: state,
      duration: timeForLineAnimation,
      useNativeDriver: false,
    });
    const firstAnimatedBottomLine=Animated.timing(bottomLineValue, {
      toValue: state,
      duration: timeForLineAnimation,
      useNativeDriver: true,
    });
    const secondAnimatedTopLine=Animated.timing(topLineValue,{
      toValue:state,
      duration:timeForLineAnimation,
      useNativeDriver:true
    })
    const secondAnimatedBottomLine=Animated.timing(topLineValue,{
      toValue:state,
      duration:timeForLineAnimation,
      useNativeDriver:true
    })
    Animated.timing(middleLineValue, {
      toValue: state == 0 ? 1 : 0,
      duration: state == 1 ? 10 : timeForLineAnimation, // Змінив на 1000 мс (1 секунда) для прикладу
      useNativeDriver: true,
    }).start();
    Animated.sequence([Animated.parallel([firstAnimatedBottomLine,firstAnimatedTopLine]),Animated.parallel([secondAnimatedBottomLine,secondAnimatedTopLine])]).start()
    Animated.timing(scrollX, {
      toValue: state,
      duration: timeForLineAnimation*1.3,
      useNativeDriver: true,
      easing: Easing.bezier(0,0,0,0),
    }).start();
   // console.log(state==2?0:1)
    //setTimeout(function(){hamburgerAnimation(e)},5000);
  };

  return (
    <View
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        right: 0,
        zIndex: 5,
      }}
    >
      <View style={headerstyles.gapContainer} />
      <View style={headerstyles.container}>
        
        <View style={[headerstyles.header]}>
          <Animated.View
            style={[{
              justifyContent: "flex-start",
              flexDirection: "row",
              width: screenWidth * 0.96,
            },{transform:[{translateX:scrollXPosition}]}]}
          >
            <MagnifyingGlass style={headerstyles.magnifyingglass} />
            <ModeOfEmployment />
            <TouchableOpacity onPress={hamburgerAnimation}>
              <View style={headerstyles.hamburgerview}>
                <Animated.View
                  style={{
                    transform: [
                      { rotate: topLineRotation },
                      { translateX: positionXOfTopLine },
                    ],
                  }}
                >
                  <Line
                    screenWidth={
                      state == 0 ? screenWidth * kefOfTransform : screenWidth
                    }
                    screenHeight={screenHeight}
                  />
                </Animated.View>
                <Animated.View style={{ opacity: middleLineValue }}>
                  <Line screenWidth={screenWidth} screenHeight={screenHeight} />
                </Animated.View>
                <Animated.View
                  style={{
                    transform: [
                      { rotate: bottomLineRotation },
                      { translateX: positionXOfTopLine },
                    ],
                  }}
                >
                  <Line
                    screenWidth={
                      state == 0 ? screenWidth * kefOfTransform : screenWidth
                    }
                    screenHeight={screenHeight}
                  />
                </Animated.View>
              </View>
            </TouchableOpacity>
          </Animated.View>
          <Animated.View
            style={[{ width: screenWidth * 0.8, backgroundColor: "red",},{transform:[{translateX:scrollXPosition}]}]}
          ><View></View></Animated.View>
        </View>
      </View>
    </View>
  );
}
